import { motion } from "framer-motion";
import "../../App.css"


function Skills (){
return  (<div className="containter">
    <div>
        <h2>Let's go to work together!</h2>
    </div>
    <div>
        <p>My email:</p>
        <a href="mailto:lautarolopardo95@outlook.es" title="email-page">lautarolopardo95@outlook.es</a>
    </div>
    <div>
        Social media:
        Linkedin:
        <a href="https://www.linkedin.com/in/lautaro-marcelo-lopardo-546203206/"></a>
    </div>
    
</div>);
}
export default Skills;
